webpackJsonp([28513677789427],{396:function(e,i){e.exports={data:{markdownRemark:{html:'<h3>Описание:</h3>\n<p>Данное упражнение напоминает некий гибрид сразу нескольких упражнений на петлях. С биомеханической точки зрения отведение рук напоминает разводку. Движение достаточно легкое и не составит труда для новичков. Но и опытным не стоит им пренебрегать особенно если вы не уделяете должное внимание растяжке.</p>\n<h3>Порядок выполнения:</h3>\n<ol>\n  <li>Выровняйте петли, чтоб оба конца были ровны.</li>\n  <li>Возьмитесь за рукояти, вытяните руки вперед, натяните петли</li>\n  <li>Руки чуть согнуты в локтях.</li>\n  <li>Начните движение, уводя одну руку вниз-в сторону, другую вверх-в сторону.</li>\n  <li>Почувствуйте растяжение целевых мышц.</li>\n  <li>Одним плавным движением вернитесь в исходное положение.</li>\n  <li>Так повторять заданное количество повторений.</li>\n</ol>\n<h3>Советы:</h3>\n<ul>\n  <li>Соблюдайте плавность движения</li>\n  <li>В зависимости от постановки ног относительно крепления варьируйте нагрузку.</li>\n</ul>\n<h3>Видео-инструкция:</h3>\n<iframe width="100%" height="550rem" src="https://www.youtube.com/embed/z9Yyw0cYnPQ" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>',frontmatter:{path:"/exercise/otvedenie-ruk-vniz-vverh-na-petlyah",efficiency:"5",title:"Отведение рук вниз-вверх на петлях",image:"/static/0-14-0.png",image_2:"/static/0-14-1.png",image_3:"",image_4:"",filterby:"chest",date:"July 12, 2017",injury:"3",bodypart:"Грудь",filtertype:"base",type:"Базовое",filterinventory:"trx",inventory:"TRX Петли",filterplace:""}}},pathContext:{}}}});
